import React from 'react';
import './App.css';

const App = () => {
  return (
    <div>
      <div><Header /></div>
      <div className="App">
        <ul>
          <li>Ppll </li>
          <li>Ppll2</li>
          <li>Ppll1</li>
          <li>Ppll4</li>
        </ul>
      </div>
    </div>
  );
}

const Header = () => {
  return (
      <div className="App">
        <ul>
          <a href='#s'>Home</a>
          <a href='#s'>News Feed</a>
          <a href='#s'>Messenges</a>
        </ul>
      </div>
  );
}

export default App;
